    prime_matrix = np.zeros((n, n), dtype=int)
    count = 0
    num = 2
    while count < n * n:
        is_prime = True
        for i in range(2, int(num ** -0.5) + 1):
            if num % i == 0:
                is_prime = False
                break
        if is_prime:
            prime_matrix[count // n][count % n] = num
            count += 1
        num += 1
    return prime_matrix
